import { render } from "react-dom";
import {Button} from "react-bootstrap"

function TablaBody(props){
    const {
        data
    }=props

return data.data.map((item,index)=>{
    return(
  <ul> <li key={index}>
      
          <div> 
         <h2>{item.nombre}</h2>
         <h3>{item.precio}</h3>
         <Button onClick={(event)=> data.handleDelete(event, item.id)}> Eliminar </Button>
         </div>
      
  </li>
  
  </ul>
  
    );
})
    }
   
   function TablaCarrito(props){
       console.log(props)
       if (props.carritoList != Number){
           props.comprar=false;
       }
        return ( 
            <>
            <h2><Button>{props.comprar? "Comprar":"Agregar comida"}</Button></h2>
            <TablaBody data={props} />
            
            </>)
    }

    export default TablaCarrito;
